import React, {Component, createElement} from 'react';
import './SongStyle/SongStyle.css';
import Axios from 'axios';
import Link from 'next/link';

class SongList extends Component{
    constructor(props){
        super(props)
        this.state = {
          songs: []
        }
    }     
    GetSongs() {
        //console.log(this.state);
        Axios.get('http://localhost:3210/allSongs').then ((response) => { this.setState({songs: response.data})});
        //console.log(this.state.songs);
    }
    componentDidMount(){
        this.GetSongs();
    }
    render(){
        return(
            <ul>
                hi there
                {this.state.songs.map((value) => {console.log(value)
                    return (

                        <SongRef
                        name = {value.name}
                        comp_id = {value.comp_id}
                        />
                    );
                })}
            </ul>
        );
    }



}

const SongRef = props =>(
    <Link href = './Song'>
        <li><a>{props.comp_id} - {props.name}</a></li>
    </Link>
);

export default SongList;
